import React from "react";

function Footer(){

let date = new Date();
let year = date.getFullYear();    
return (
    <div>
    <footer>
    copyright <img src="https://img.icons8.com/windows/32/000000/copyright.png"/> {year}
    </footer>
    </div>
);
}

export default Footer;
